INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000002', null, '生源地信用助学贷款', '', '', '10,1002', '10,1008', '23,2300', '九江、上饶、景德镇、吉安、萍乡、鹰潭等六设区市辖内县（市、区）农村信用合作联社（农商银行）向相应县（市、区）学生资助管理中心确认符合条件的家庭经济困难的普通高校（包括全日制普通本科高校、高等职业学校和高等专科学校）新生和在读学生发放的、在学生入学前户籍所在地办理的助学贷款。在校期间由财政贴息，毕业后的利息由学生自己承担', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', '1123598821738675201', '1123598813738675201', '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000004', null, '股权反担保贷款', null, null, '10,1001,1002,1003,1004', '10,1006,1007,1009,11,1101,1102,1103,1104', '20,2002', '借款人或第三人自愿以其所拥有的农村信用社（农商银行）股权质押给为其担保的保证人作为反担保质押，以偿付保证人履行担保责任后所发生的债务。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000005', null, '百福惠民卡', null, null, '10,1001,1002', '10,1006,1007,1009', '20,2001,2002,2003,2004,2005,2006,2099,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '对已评级授信的自然人客户，以百福惠民卡为载体，采用自助可循环方式，在核定的授信期限和授信额度内，客户可通过柜台、ATM、转账终端、转账电话、pos、电话银行、网上银行等方式随还随借、循环使用的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000006', null, '动产质押贷款', null, null, '10,1001,1002,1003,1004', '10,1006,1007,1009,11,1101,1102,1103,1104', '21,2102,2103,2104,2105,2106,2109,2199', '是指江西省农村信用社发放的由债务人或者第三人将其动产移交债权人占有，将该动产作为债权的担保贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000007', null, '商铺按揭贷款', null, null, '10,1001', '10,1006,1007,1009', '22,2201', '购房借款人以其所购的一手房屋（商业用房）作为抵押物发放的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
