INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000009', null, '农户小额信用贷款', null, null, '10,1001,1002', '10,1006,1007', '23,2300', '基于农户的信誉、资产和还款来源等情况，在核定的信用额度内向农户及农村个体工商户发放的不需担保的用于经营性的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
