INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000083', null, '农民专业合作社贷款', null, null, '10,1001', '10,1006,1007,1009', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '农民专业合作社贷款是指江西省农村信用社（农商银行）与辖内农民专业合作社开展合作，对农民专业合作社成员发放的用于生产经营的贷款。合作社成员是指能够利用农民专业合作社提供的服务，承认并遵守农民专业合作社章程，履行章程规定的入社手续，具有民事行为能力的公民', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000084', null, '备用信用证', null, null, '40,4002', '11,1101,1102,1103,1104', '', '国外保函指本行接受客户申请或接受其他银行委托以保函或备用信用证形式出具的以境外（含港澳台）机构为受益人的保证业务，或接受境外银行委托出具的以境内机构为受益人的保证业务，当借款人未按期偿还时，由我行履行还款责任。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000085', null, '提单背书', null, null, '', '', '', '提货担保是指银行根据客户（开证申请人）的要求，为其开立信用证后，在进口货物先于承运货物提单到达时，为客户先行提货而向承运人（船公司或其他运输公司）出具的书面保证书。提单背书分为副本提单背书和1/3正本提单背书两种情况，前者是基于与提货担保同样的原因，应客户请求，银行对客户出示的副本提单（NON-NEGOTIABLE COPY）进行背书以便于客户先行提货；后者是在正本提单以开证银行为抬头的情况下，在信用证规定的单据到达之前，应客户要求，为便于其提货，银行对客户提供的1/3正本提单进行背书的行为', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000086', null, '种粮大户财政贴息、担保贷款（简称种粮大户贴息贷款）', null, null, '10,1001', '10,1006', '20,2001', '江西省农村信用社（农商银行）种粮大户贴息贷款是由农村信用社发放、江西省信用担保股份有限公司担保、省财政贴息（贴息70%）的贷款，种粮大户为水稻种植在本县（市、区）实际耕种水田300亩（含）以上，水稻种植专业合作社实际耕种1000亩（含）以上、并经认定为2013年省级示范社。种粮大户由农业、财政部门共同认定。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000089', null, '法人商业用房按揭贷款', null, null, '10,1004', '11,1101,1102,1103,1104', '22,2201', '向购买自营商业用房或自用办公用房、厂房（以下简称商业用房）的法人客户，以所购商业用房作为抵押物的贷款。按揭贷款的房屋分为一手房和二手房，一手房是指开发商新建并首次销售的商业用房；二手房是指开发商以外的售房人再次在市场上交易的商业用房。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000090', null, '二手房按揭贷款', null, null, '10,1001,1002,1004', '10,1006,1007,1009,11,1101,1102,1103,1104', '22,2201', '购房借款人以其所购的二手房屋（包括商用房（门面、店铺、写字楼、非住宅等）、商品房、经济适用房、房改房及允许上市交易的房屋）作为抵押物发放的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000091', null, '“财园信贷通”贷款', null, null, '10,1003', '11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“财园信贷通”是指政府安排专项资金与农村信用社合作，帮助工业园区企业获得流动资金贷款的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000092', null, '土坯房改造贷款', null, null, '10,1002', '10,1006', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '是指江西省农村信用社向被列入农村危旧土坯房改造的农户发放的用于支持危旧土坯房改造的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000093', null, '农民住房财产权抵押贷款', null, null, '10,1001,1002', '10,1006', '22,2201', '农民住房财产权抵押贷款是指在不改变宅基地所有权性质的前提下，以农民住房所有权及所占宅基地使用权作为抵押，由农村信用社向符合借款条件的农民住房所有人发放的、在约定期限内还本付息的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000094', null, '“财政助保”贷款', null, null, '10,1002', '10,1006,1009', '23,2300', '依据《参加城镇职工基本养老保险的生活困难人员享受财政助保贷款的实施办法（试行）》，本着自愿申请、公开透明的原则，向符合城镇职工基本养老保险参保条件的城镇职工发放的用于一次性缴纳城镇职工基本养老保险的差额部分，并自愿以其养老保险金（含丧葬、抚恤金）作为还款来源的信用贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000097', null, '准全额保证金银行承兑汇票', null, null, '50,5001', '11,1101,1102,1103,1104,1105', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '准全额保证金银行承兑汇票业务是指江西省农村信用社（农商银行）根据客户保证金金额、保证金存款期限，承兑不大于保证金与其孳息金额之和的银行承兑汇票业务。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000098', null, '票易宝', null, null, '50,5001', '11,1101,1102,1103,1104,1105', '21,2104', '“票易宝”业务是指客户以持有符合贴现规定的银行承兑汇票或商业承兑汇票作为质押，江西省农村信用社（农商银行）为客户新签发的银行承兑汇票办理承兑，保证客户的结算需要并向客户提供一定理财服务的票据业务操作形式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000099', null, '银票质押贷款', null, null, '10,1003,1004', '11,1101,1102,1103,1104,1105', '21,2101,2104', '银行承兑汇票质押贷款业务是指客户以符合贴现规定的银行承兑汇票作为质押，江西省农村信用社（农商银行）为客户提供短期流动资金贷款的一种票据业务操作形式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000100', null, '银票质押委托贷款', null, null, '20,2002', '11,1101,1102,1103,1104,1105', '21,2104', '票据委托贷款是指成员行社撮合委托人和借款人，借款人以符合银行贴现规定的银行承兑汇票作为质押，委托人发放委托贷款给借款人，以银行承兑汇票托收回来的资金作为委托贷款还款资金的一种组合融资方式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000101', null, '银票封闭敞口循环开票', null, null, '50,5001', '11,1101,1102,1103,1104,1105', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '是指江西省农村信用社（农商银行）在为客户核定一年期循环使用银行承兑汇票授信额度后，客户在银行承兑汇票到期前，提前交足保证金填满银行承兑汇票敞口，为客户循环签发银行承兑汇票的一种票据业务操作形式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000102', null, '保金封闭敞口循环开票', null, null, '50,5001', '11,1101,1102,1103,1104,1105', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '是指成员行社为客户核定一年期循环使用银行承兑汇票额度情况下，客户在银行承兑汇票到期前，以收到符合贴现规定的银行承兑汇票作为质押封闭银行承兑汇票敞口后，重新启用授信额度，为客户循环办理银行承兑汇票的一种套餐服务模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000103', null, '财政惠农信贷通', null, null, '10,1001,1003,1004', '10,1006,1007,1009,11,1101,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“财政惠农信贷通”贷款是指政府安排专项资金作为贷款风险补偿金，由农工部、财政、农业、林业等部门与农村信用社合作，帮助新型农业经营主体（以下简称申请人）获得生产经营资金的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000104', null, '“财园信贷通”贷款—旅游企业', null, null, '10,1003', '10,1006,1007,1009,11,1101,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“财园信贷通”—旅游企业是指政府安排专项资金与农村信用社合作，帮助成员行社辖内涉及旅游的经济实体（含法人企业、合伙制企业和个体工商户等各种经济实体）获得流动资金贷款的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
