INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000114', null, '白领贷', null, null, '10,1002', '10,1009', '20,2001,2003', '“白领贷”是指农村信用社（农商银行）向具有稳定职业和收入、个人征信记录良好的企事业白领等优质高端自然人客户发放的个人保证贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
