INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000120', null, '续贷保', null, null, '10,1001,1003', '10,1006,1007,1009,11,1101,1102,1103,1104,1105', '20,2001,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“续贷保”指基于银行间信用，以“低成本、免担保、普惠式”为原则，由农商银行向辖区内各商业银行借款的中小企业发放的一种专项为筹集续贷（仅限于流动资金贷款）资金的短期人民币贷款产品。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000121', null, '引导基金信贷通', null, null, '10,1003', '11,1101,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“引导基金信贷通”是指由财政提供贷款风险代偿保证金，萍乡农商银行提供信贷资金，向符合条件的战略性新兴产业和科技创新投入较大的企业发放的流动资金贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000122', null, '科技创贷通', null, null, '10,1003', '11,1101', '20,2001,21,2101', '“科技信贷通”是农村信用社（农商银行）与科学技术局合作，由科学技术局安排专项资金做担保，帮助科技型中小微企业获得贷款的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000123', null, '扶贫小额信用贴息贷款', null, null, '10,1001', '10,1006', '23,2300', '扶贫小额信用贴息贷款是农村信用社向当地扶贫办已建档立卡的一般贫困户和扶贫低保户，基于其社会诚信度、信用记录、家庭劳动力占比、家庭劳动力技能、家庭人均年纯收入等情况，在评级授信的基础上向其发放的信用贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000124', null, '百福“备用金”', null, null, '10,1001,1002', '10,1006,1007,1009', '20,2001,21,2101,22,2201,23,2300', '百福“备用金”贷款指以百福惠民卡为载体，采用自助循环方式，在核定的授信额度和期限内，通过柜台、自助终端（ATM/CRS/POS）、手机银行、网上银行等多种渠道随借随还，用于个人临时资金周转的个人超短期贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000130', null, '抚州市个人住房公积金委托贷款', null, null, '20,2001', '10,1006,1007,1009', '22,2201', '个人住房公积金委托贷款是指由委托人即当地住房公积金管理中心提供资金，由受托人即江西省农信社各成员行社根据委托人确定的贷款对象、用途、金额、期限、利率等代为发放（用于购买住宅并以该房产作抵押物）、监督使用并协助收回的贷款业务。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000135', null, '商业承兑汇票保贴业务', null, null, '30,3002,3003,3004', '11,1101,1102,1103,1104,1105', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '商业承兑汇票保贴业务（以下简称商票保贴）是指对特定承兑人承兑的商业承兑汇票或对特定贴现申请人持有的商业承兑汇票，本行承诺在授信额度和一定期限内以商定的贴现利率予以贴现。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000136', null, '产业扶贫信贷通', null, null, '10,1001,1003', '10,1006,11,1101,1104', '20,2001,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '产品扶贫信贷通是赣州市政府与辖内农商银行合作，由赣州财政局筹资设立风险缓释基金，由农商银行向辖内建档立卡贫困户发放贴息贷款，支持贫困户发展产业脱贫致富。1、扶持对象：具有从事相关产业的劳动能力和完全民事行为能力的建档立卡贫困人口，以及贫困户参与且辐射面广、带动致富能力强、能有效带动贫困户脱贫致富的企业、农民专业合作组织。2、扶持产业：主要支持发展蔬菜、刺葡萄、茶叶、白莲、烟叶、生态鱼、甜叶菊、芳香苗木等地域特色明显、见效快、可持续的种养殖业及其他扶贫效果好的产业。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000137', null, '“百福家居”综合消费贷', null, null, '10,1002', '10,1006,1007,1009', '20,2001,21,2101,22,2201,23,2300', '“百福家居”综合消费贷（简称“百福家居贷”）指农村信用社（农商银行）向已建立合作关系的家居装修公司签约客户，按照预算总额一定比例，指定发放的家装消费用途贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000138', null, '支持江西省服务业发展流动资金贷款', null, null, '10,1003', '11,1101,1102,1103,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '省联社与省发改委、省财政厅合作，以省级财政预算安排的用于支持全省服务业发展的专项资金作为风险补偿资金，支持省内服务业企业开展生产经营活动而发放的流动资金贷款。服务业主要包括信息、物流、科技、家政、健康养老、旅游、文化、商贸等领域。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000139', null, '支持江西省服务业发展固定资产贷款', null, null, '10,1004', '11,1101,1102,1103,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '省联社与省发改委、省财政厅合作，以省级财政预算安排的用于支持全省服务业发展的专项资金作为风险补偿资金，支持省内服务业企业项目建设而发放的固定资产贷款。服务业主要包括信息、物流、科技、家政、健康养老、旅游、文化、商贸等领域。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000140', null, '百福农机贷', null, null, '10,1001', '10,1006,1009', '20,2001', '百福农机贷是江西省农村信用社（农商银行）向辖区内从事农业生产经营的农户或其他自然人发放的、用于购买农业机具的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000141', null, '创业信贷通', null, null, '10,1001,1003,1004', '10,1006,1007,1009,11,1101,1104', '20,2001,22,2201,2202,2203,2204,2205,2206,2207,2299', '创业信贷通是指以财政资金作为风险保证金存入农村信用社（农商银行）账户，农村信用社（农商银行）向符合条件的大中专院校毕业生、退役军人、创业大学毕业学员、返乡农民工以及高校、科研完所等企事业单位在职专业技术人员提供的50万元以内无需抵押担保的创业贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000142', null, '小微信贷通', null, null, '10,1001,1003,1004', '10,1006,1007,1009,11,1101,1104', '20,2001,22,2201,2202,2203,2204,2205,2206,2207,2299', '小微信贷通是指以财政资金作为风险保证金存入农村信用社（农商银行）账户，农村信用社（农商银行）向符合条件的个体工商户和小微企业提供200万元以内无需抵押担保的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000143', null, '农村承包土地的经营权抵押贷款', null, null, '10,1001,1002,1003', '10,1006,1007,1009,11,1101,1104', '22,2202', '农村承包土地的经营权抵押贷款是指在不改变土地所有权性质、不转移土地占有和农业用途的条件下，以依法承包或流转取得的农村土地经营权作抵押，由农村信用社向符合条件的承包方农户或农业经营主体发放的、在约定期限内还本付息的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000144', null, '医药流通信用贷', null, null, '10,1003', '11,1101', '23,2300', '“医药流通信用贷”是指针对医药流通企业的经营规模、税收贡献及在银行的业务归账情况作为主要授信依据，用于满足医药流通企业在生产经营中的短期资金周转需求的贷款产品。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000145', null, '居民简易贷', null, null, '10,1001,1002', '10,1006,1007,1009', '23,2300', '“居民简易贷”指农村信用社基于客户的道德品质、经济实力、偿债能力、客户贡献等，运用统一、公开的评价方法，对辖内居住的城镇居民进行定量和定性分析，评定客户信用等级和核定最高授信额度。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000146', null, '“百福助学”贷款', null, null, '10,1002', '10,1008', '20,2001,23,2300', '“百福助学”贷款向取得江西省生源地信用助学贷款后仍需要资助其在校期间的学费和住宿费用的贫困学生发放的贷款。在校期间由县财政贴息，贷款本金及毕业后的利息由学生自已偿还。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000147', null, '“百福税贷通”贷款', null, null, '10,1003', '11,1101', '20,2001,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“百福税贷通”贷款是指根据纳税税额向在税务系统纳税信用等级评定为B级、A级的企业发放的，用于借款人生产经营的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000148', null, '“国际农发基金惠农信贷通”贷款', null, null, '10,1001,1003', '10,1006,1007,1009,11,1101,1104', '20,2001,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“国际农发基金惠农信贷通”贷款是指国际扶贫组织安排专项资金作为贷款风险补偿金，由农业局、财政局等部门与农村信用社（农商银行）合作，帮助新型农业经营主体获得生产经营资金的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000149', null, '百福光伏·分期贷', null, null, '10,1001,1002', '10,1006,1007,1009', '20,2001,2002,2003', '“百福光伏分期贷”是指基于农村信用社（农商银行）与分布式光伏电站项目合作方的合作，向本市辖区范围内符合分布式光伏电站安装条件的个人客户发放的，依据借款人的信用记录、资产负债和实际还款能力等情况，在融资需求规定额度内的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000150', null, '诚商信贷通', null, null, '10,1001', '10,1006,1007', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“诚商信贷通”贷款是以个体工商户为主体，根据个体工商户道德评定，依据个人信誉、家庭财产、经营情况为保证，在核定的授信额度内发放的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000151', null, '百福光伏贷', null, null, '10,1001', '10,1006,1007,1009', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '百福光伏贷针对辖内企业、居民单个成员发放用于光伏发电站建建设的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000152', null, '光伏贷', null, null, '10,1001', '10,1006,1007,1009', '20,2001,2002,2003,23,2300', '“光伏贷”是指政府在合作银行设立担保基金专户，合作银行按担保基金的1：8比例对符合贷款条件的贫困户，因安装光伏发电设施缺少资金而发放的人民币贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000153', null, 'e贷通', null, null, '10,1002', '10,1006,1007,1009', '23,2300', '根据职场新人、中青年创业人员等人群的线上信用状况，在核定的授信额度内发放的不需要提供抵（质）押物担保的信用贷款，主要用以满足其装修建材、家具家电、婚庆用品、百货消费、旅游消费等需求的消费性贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000154', null, '百福金穗贷', null, null, '10,1001,1003', '10,1006,1007,11,1101,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '为更好地支持三农发展，提高信贷服务水平，解决本、异地从事种子生产行业的自然人、农村新型经营主体、农村企业融资难问题，根据其实际经营情况而发放的经营性短期贷款', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000155', null, '百福·薪易贷', null, null, '10,1002', '10,1009', '20,2001,2003,23,2300', '“百福薪易贷”主要是为满足公职人员及部分企业干部员工家庭生活和消费的信贷需求，农村信用社（含农商银行、合作银行，下同）基于申请人的信誉、资产和年收入等情况，在核定的授信额度内不需提供担保的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000156', null, '财政电商信贷通', null, null, '10,1001,1003,1004', '10,1007,11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“财政电商信贷通”是指政府安排专项资金作为“财政电商信贷通”贷款风险补偿金（以下简称“财政风险补偿金”），由政府相关部门与农商银行，帮助辖区内电子商务企业、个体工商户获得贷款的融资模式。  ', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000157', null, '光伏产业扶贫贷款', null, null, '10,1003,1004', '11,1101,1102,1104', '20,2001,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '光伏产业扶贫贷款是指向乡镇或村民组织主导成立的光伏扶贫电站或光伏产业有限责任公司（以下简称光伏企业）发放的扶贫贷款,属扶贫和移民产业贷款的子产品。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000158', null, '电瓷企业投标保证金信用贷款', null, null, '10,1003', '11,1101,1104', '23,2300', '电瓷企业投标保证金信用贷款是指芦溪农商银行向辖内的电瓷企业因其投标保证金需求而发放的信用贷款，并追加企业法人及股东承担连带担保责任。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000159', null, '百福创业基金贷', null, null, '10,1003', '11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“百福创业基金贷”是指政府安排专项资金作为贷款风险补偿基金与农商银行合作，帮助符合信贷条件的小微企业获得流动资金贷款的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000160', null, '百福工业发展贷', null, null, '10,1003,1004', '11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299', '“百福工业发展贷”贷款，是指对在赣县辖区内注册登记的法人客户符合国家产业政策,重点支持我区稀土和钨新材料及应用、生物食品、电子信息、装备制造等规模以上工业企业；成长性好、科技含量高、有发展前景的科技型中小企业；符合辖区主导产业固定资产投资规模的工业项目及经辖区主攻工业领导小组认定需支持的工业企业发放的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000161', null, '矿保通', null, null, '10,1003', '11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299', '“矿保通”是指崇义县绿科工业投资有限责任公司（以下简称工投公司）安排专项资金与农商银行合作，帮助工投公司会员获得农商银行贷款的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000162', null, '百福装修贷', null, null, '10,1002', '10,1006,1007,1009', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '百福装修贷是指向个人客户发放的用于自用住房家居装修消费的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000163', null, '二手车按揭贷款', null, null, '10,1002', '10,1006,1007,1009', '23,2300', '二手车按揭贷款是指对在特约经销商处购买二手车的借款人发放的贷款，是采取分期还款的方式归还贷款的一种贷款。（合作公司按照单笔担保业务贷款金额5%比例存入保证金提供担保）', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000164', null, '银赁通', null, null, '10,1003', '11,1101,1105', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299', '“银赁通”业务是指应租赁公司申请，以受让租赁公司融资租赁合同项下的未到期应收账款的方式，为其提供的保理融资。如无追索权保理，租赁公司仅发挥通道作用。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000165', null, '百福安居农房贷', null, null, '10,1002', '10,1006', '20,2001,2002,2003', '百福安居农房贷是向辖内符合拆迁安置农民群体发放的用于在购置住房一次性缴纳房款差额部分的保证贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000166', null, '被征地农民养老保险项目贷款', null, null, '10,1003', '11,1101,1102', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“被征地农民养老保险项目贷款”是向“政府购买服务”项目的企、事业单位发放的，专用于补充被征地农民养老保险缴费补贴的中长期流动资金贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000167', null, '应对H7N9紧急救助贷款', null, null, '10,1001,1003', '10,1006,1007,1009,11,1101,1104', '20,2001,2002,2003', '应对H7N9紧急救助贷款是指为应对全省H7N9疫情，对经省畜牧兽医局审核确定的名单，由省农业信贷担保公司提供全额担保的特色贷款产品。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000168', null, '扶贫光伏贷', null, null, '10,1001,1003,1004', '10,1006,1009,11,1101,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '扶贫光伏贷”贷款是指农商银行对辖内“一户一站”模式建档立卡的贫困户、“村级电站”模式组建的农民专业合作组织以及“地面电站”模式合作组织等个人、合作组织或法人发放的用于建设光伏发电站的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000169', null, '出口退税权利质押融资', null, null, '1003', '11,1101', '21,2109', '“出口退税权利质押融资”是指为解决出口企业出口退税款未能及时到账而出现的短期资金困难，在以该企业的出口退税账户实行托管的前提下，向出口企业提供的以出口退税应收款作为还款担保的短期流动资金融资服务。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000170', null, '百福汽运贷', null, null, '10,1001', '10,1006,1009', '22,2205', '百福汽运贷款是指在辖区购买汽车用于商业营运并由挂靠的汽车经销商提供担保的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000171', null, '百分百贷', null, null, '10,1003,1004,1001', '10,1006,1007,1009,11,11011104,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“百分百贷”贷款是指以拥有房产的优质客户为对象，在对客户信用度、贡献度、净资产、现金流、经营情况和风险状况进行综合评估的基础上，确定一揽子最高综合授信额度，在按房产抵押率确定的贷款额度之外搭配保证、信用贷款和银行承兑汇票的用信方式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000172', null, '电商信贷通', null, null, '10,1001,1003', '10,1006,1007,1009,11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“电商信贷”贷款指农商银行向电商企业发放的流动资金贷款。可通过“担保基金+合作银行”模式，也可通过政府部门提供风险补偿金的模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000173', null, '电站收费权质押贷款', null, null, '10,1001,1003,1004', '10,1006,1007,1009,11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299', '“电站收费权质押贷款”贷款是指农商银行与质押人（电站）、供电公司签订合作协议，以电站在农商银行开设的电费收入账户作质押，向借款人办理贷款的信贷业务。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000174', null, '拆迁贷', null, null, '10,1001,1002', '10,1006,1007,1009', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“拆迁贷”贷款，是指本行基于拆迁户的信誉、资产和还款来源等情况，在拆迁款尚未到发放到位前，在与拆迁户签订协议的前提下，向拆迁户发放的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000175', null, '百福田园贷', null, null, '10,1001', '10,1006,1007,1009', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299', '“百福田园贷”贷款，指农商银行对自然人发放的，用于满足休闲山庄、农家乐、家庭农场等旅游项目的装修、扩建或经营流动资金等需求的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000176', null, '光伏利民通', null, null, '10,1001,1002,1003,1004', '10,1006,1009', '20,2001,2002,2003,23,2300', '“光伏利民通”贷款是指我行参与政府光伏扶贫工程，以产业扶贫信贷通贷款为平台，由政府提供风险保证金，解决政府推荐或自行参与该项目的贫困户资金不足问题的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000177', null, '安居层层高', null, null, '10,1002', '10,1006,1007,1008,1009', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“安居层层高”贷款是指借款人向农商银行申请贷款授信额度用于建房，根据借款人房屋建造进度逐层发放的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000178', null, '百福药商贷', null, null, '10,1001', '10,1007', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“百福药商贷”是指农商银行基于中药材专业市场商户的信誉、资产、经营收入、担保和与农商银行结算往来等情况作为主要授信依据，在核定的授信额度内发放的贷款，用于满足商户在经营中的短期资金周转需求的贷款产品。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000179', null, '校具订单贷', null, null, '10,1003', '11,1101', '20,2001,2002,2003', '“校具订单贷”贷款是指以校具生产企业通过政府招投标销售订单或转加工合同预期销售收入为第一还款来源，由企业或个人提供担保，帮助符合信贷条件的小微校具生产企业获得流动资金贷款的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000180', null, '百福商圈贷', null, null, '10,1001,1003', '10,1006,1007,1009,11,1101', '20,2001,2002,2003,21,2101,22,2201,23,2300', '百福商圈贷是指针对已入驻农商银行百福生活圈，利用本行POS终端结算往来业务的合作商户，参考其结算流水（日均余额）、家庭资产、合作期间月让利金额等条件，用于满足小微商户在生产经营中短期资金周转需求的贷款业务。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000181', null, '城乡安居贷', null, null, '10,1002', '10,1006,1007,1008,1009', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '是指为支持妥善处理违法用地违规建设行为,进一步加强城乡规划内建设管控，积极为推进改善城乡人居环境，依据政策导向，强化资金管理，优化贷款结构，提高信贷资金的使用效益。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000182', null, '助保贷', null, null, '10,1002', '10,1006,1007,1009', '23,2300', '助保贷是农商银行向已达到领取养老金要求但未缴纳足够社保金的借款人发放的用于缴交社保，无需提供担保的人民币贷款，并自愿以其养老金（含丧葬、抚恤金）作为还款来源的信用贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
