INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000212', null, 'LED应用产业信贷通', null, null, '10,1003', '11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299', '“LED应用产业信贷通”是瑞昌市人民政府安排资金与江西瑞昌农村商业银行股份有限公司合作，帮助瑞昌市LED应用产业企业获得流动资金贷款的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000213', null, '面包贷', null, null, '10,1001,1003,1004', '10,1006,1007,1009,11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“面包贷”贷款是指资溪农商银行对资溪籍面包经营商户发放的授信支持，包括但不限于：个人经营性贷款、流动资金贷款、固定资产贷款、联保贷款等。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000214', null, '红培贷', null, null, '10,1003', '10,1007,11,1101,1102,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“红培贷”贷款，是指井冈山农商银行基于红色培训机构的信誉、资产、收入以及经营等情况，在核定的额度内向红色培训机构发放的授信贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000215', null, '畜禽洁养贷', null, null, '10,1004', '11,1101,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '用于畜禽养殖废弃物无害化处理和资源化利用项目的固定资产贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000216', null, '财政惠农信贷通（省农担）', null, null, '10,1001,1003,1004', '10,1006,1007,1009,11,1101,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“财政惠农信贷通”贷款是指政府安排专项资金作为贷款风险补偿金，由农工部、财政、农业、林业等部门与农村信用社合作，帮助新型农业经营主体（以下简称申请人）获得生产经营资金的融资模式。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000217', null, '订单融资', null, null, '10,1003', '11,1101,1104', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299', '订单融资指融资申请人（订单中的卖方，以下简称“卖方”）与买方在签署合法有效订单后，农商银行为支持卖方在订单项下货物发运前采购原材料、组织商品生产、货物运输等的资金需求，以订单项下的预期销货款作为主要还款来源，向卖方提供的短期融资。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000218', null, '百福口腔贷', null, null, '10,1001,1003,1004', '10,1006,1007,1009,11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“百福口腔贷”贷款是指以从事口腔行业的个人或企业为主体，以主体资格、行业道德、信用状况、资产规模、经营收入等评定为依据，基于信誉、资产、经营收入等条件，在核定的额度内发放的最高额贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000219', null, '优信贷', null, null, '10,1003', '11,1101', '20,2001,2002,2003', '丰城农商银行“优信贷”贷款是指通过“财政+银行+担保公司”三方合作的模式，由丰城市财政向丰城农商银行存入“优信贷”贷款风险代偿保证金，担保公司为贷款提供担保，丰城农商银行按不低于保证金的8倍向丰城市符合信贷条件的企业提供贷款，合作三方各自按代偿比例承担贷款风险责任的贷款产品。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000220', null, '百福茶叶贷', null, null, '10,1001,1003', '10,1006,1007,1009,11,1101', '20,2001,2002,2003,21,2101,2102,2103,2104,2105,2106,2107,2108,2109,2110,2199,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“百福茶叶贷”是指为从事茶叶种植、销售等企业、个体工商户及茶农在一定的授信额度内提供可循环的金融融资服务。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000221', null, '百福电商贷', null, null, '10,1001,1003', '10,1006,1007,1009,11,1101', '20,2001,2002,2003,23,2300', '“百福电商贷”是指本办法授信对象为依托“天猫商城”和“京东商城”（以下简称商城）从事商品销售的自然人或小微企业法人。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
