INSERT INTO CLM.TB_PAR_PRODUCT (PRODUCT_NUM, SYS_PRODUCT_NUM, PRODUCT_NAME, SUPER_PRODUCT_NUM, SUPER_PRODUCT_NAME, PRODUCT_TYPE, CUST_TYPE, GUARANTEE_TYPE, PRODUCT_DESCR, PRODUCT_STATUS_CD, LIMIT_USED_TYPE, SYS_NO, RISK_EXPOSURE_TYPE, PRODUCT_TARGER, INOUT_TABLE, VAILD_TIME, USER_NUM, ORG_NUM, UPDATE_USER_NUM, UPDATE_ORG_NUM, CREATE_TIME, UPDATE_TIME, IS_DELETED) VALUES ('1000223', null, '军民融合信贷通', null, null, '10,1003,1004', '1101', '20,2001,2002,2003,22,2201,2202,2203,2204,2205,2206,2207,2299,23,2300', '“军民融合信贷通”是指为满足航空航天配套企业和军品生产企业的资金需求，指借款企业向我行申请贷款时，由市中小企业担保中心为企业提供担保，省再担保公司为市中小企业担保中心提供再担保发放的贷款。', '2', '1', '1', '1', '1', '1         ', null, '1123598821738675201', '1123598813738675201', null, null, '2019-11-20', '2019-11-20', 0);
